import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';

const style = {
    paper: {
        padding : "15px",
        margin : "10px 0 10px 0"
    }
}

export default function Content() {
    return (
        <Grid container>

            <Grid item xs>
                <Paper >
                    <Typography variant = "button" color = "black">Lets Do it
                    </Typography>
                </Paper>
            </Grid>
            <Grid item xs>
                <Paper style = {style.paper}>
                    <Typography variant = "button" color = "black">Lets Do it
                    </Typography>
                </Paper>
            </Grid>

        </Grid>
    )
}
